import React, { useEffect, useState } from 'react';

const StudentProfile = () => {
  const [student, setStudent] = useState(null);

  useEffect(() => {
    // Fetch student profile data
    const fetchStudentProfile = async () => {
      const response = await fetch("http://localhost:8080/authorization/getstudent");

      if (response.ok) {
        const studentData = await response.json();
        setStudent(studentData[0]); // Assuming the API returns an array with the student data
      }
    };

    fetchStudentProfile();
  }, []);

  if (!student) {
    return <div>Loading...</div>;
  }

  return (
    <div>
      <h2>Student Profile</h2>
      <p>Username: {student.name}</p>
      <p>Email: {student.address}</p>
      {/* Add more fields as necessary */}
    </div>
  );
};

export default StudentProfile;
